<?php
// Caminho para o arquivo que armazena o contador de visitas
$contador_file = 'viu.txt';

// Verificar se o arquivo existe, se não, cria o arquivo com valor inicial 0
if (!file_exists($contador_file)) {
    file_put_contents($contador_file, '0');
}

// Ler o valor atual do contador
$contador = (int)file_get_contents($contador_file);

// Incrementar o contador
$contador++;

// Salvar o novo valor no arquivo
file_put_contents($contador_file, $contador);
?>

